import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
  Input,
} from "antd";
import Link from "next/link";
import HeaderCovid from "./components/component.headercovid";
import ShowProfile from './components/component.showprofile'
import Speechtotext from './components/component.speechtotext'
import { RightOutlined } from "@ant-design/icons";
import {useEffect, useState} from 'react'

const FormItem = Form.Item;
function CovidPage4() {
  const [isLoading,setisLoading] = useState(false)
  useEffect(() => {
    if(localStorage.getItem('jwt')){
      setisLoading(true)
    } else {
      Router.push("/page.covid1");
    }
  }, [])

  if(isLoading){
    return (
      <div style={{ marginTop: 0 }}>
        <FormItem>
          <div className="nu-font-covid">
            <div
              style={{
                display: "flex",
                flexDirection: "column",
                height: "100vh",
                width: "100vw",
              }}
            >
              <div
                style={{
                  flexBasis: "auto",
                }}
              >
                <HeaderCovid />
              </div>
              <div
                style={{
                  display: "flex",
                  flexBasis: "auto",
                  height: "100%",
                  justifyContent: "center",
                  alignItems: "center",
                  width:"100%",
                  padding:"50px"
                }}
              >
                <ShowProfile />
              </div>
              <div
                style={{
                  flexBasis: "auto",
                  display: "flex",
                  justifyContent: "flex-end",
                }}
              >
                  <Link href="/page.covidquestion">
                  <Button
                    type="primary"
                    style={{
                      fontSize: "24px",
                      height: "50px",
                      borderRadius: "33px",
                      padding: "0px 25px",
                      marginRight: "20px",
                    }}
                  >
                    เริ่มประเมิน <RightOutlined />
                  </Button>
                </Link>
              </div>
              <div
                style={{
                  flexBasis: "auto",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                <h5 style={{color:"#FFFFFF80"}}>
                  Copyright © All rights reserved. 2020 มหาวิทยาลัยนเรศวร Naresuan
                  University
                </h5>
              </div>
            </div>
          </div>
        </FormItem>
      </div>
    );
  } else {
    console.log('Loading...')
    return null;
  }
  
}

export default CovidPage4;
